import React from "react";
import { useSearchParams } from 'react-router-dom';

const EditPage = () => {
    const [params] = useSearchParams();
    const imageUrl = params.get("url"); 

    return (
        <div>
            {imageUrl && <img src={imageUrl}  />} {}
        </div>
    );
};

export default EditPage;
